import React, { Component } from "react";
import { BrowserRouter as Router } from "react-router-dom";
import NavControl from "./components/NavControl";
class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <NavControl />
        </div>
      </Router>
    );
  }
}

export default App;
